import "./App.css";
import NavBar2 from "./Components/NavBarNew";
import Home from "./Components/Home";
import About from "./Components/About";
import { Route, Routes } from "react-router-dom";
import mangekyou from "./Assets/purpleSky.jpg";

function App() {
  return (
    <>
      <header className="nightSky"></header>
      <NavBar2 />
      <body>
        <Routes>
          <Route path="/home" element={<Home />} />
          <Route path="/about" element={<About />} />
        </Routes>
      </body>
      <section>
        <img src={mangekyou} />
        <img src={mangekyou} />
        <img src={mangekyou} />
        <img src={mangekyou} />
      </section>
    </>
  );
}

export default App;
